    false,nt"url": null,nt"notes": "These data were collected by the National
    Oceanic Atmospheric Administration National Geodetic Survey Remote Sensing Division
    using a Riegl VQ820G system. The data were acquired from 20140502- 20140526 in fourteen
    missions. The data includes topobathy data in an LAS 1.2 format file classified
    as unclassified (1), ground (2), topo noise (7), refracted High Water data landward
    of the MLLW land/water interface (19), water column (25), bathymetric bottom or
    submerged topography (26), water surface (27), and International Hydrographic Organization
    (IHO) S-57 objects (31), in accordance with project specifications. The project
    consists of 58 square miles along the Atlantic Coast in Connecticut and a small
    portion of Rhode Island. Digital Elevation Models (DEMs) created from this data
    are available. These products have not been reviewed by the NOAA Office for Coastal
    Management and any conclusions drawn from the analysis of this information are not
    the responsibility of NOAA or the Office of Coastal Management (OCM). The data are
    available upon request via email at: coastal.info@noaa.gov. Please provide the name
    of the data set and "DEM Request" in the subject line.",nt"owner_org": "e811f0b4-451f-4896-9e8f-fc6802837819",nt"extras":
